                "Keyword AttributeKeyword": tags.keyword,
                Type: tags.typeName,
                Emphasis: tags.emphasis,
                "IntLiteral FloatLiteral": tags.number,
                BooleanLiteral: tags.bool,
                CharLiteral: tags.character,
